import React, { useState } from 'react';
import './Contact.css'; // Asegúrate de que la ruta al archivo CSS sea correcta

const Contact = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    message: '',
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Lógica de envío de formulario
    console.log(formData);
  };

  return (
    <div className="container-registro">
      <div className="formulario-registro">
        <img src='../assets/Logo.svg' alt="Logo CCAL" className="logo-ccal" />
        <form onSubmit={handleSubmit}>
          <div className="contenedor-doble-columna">
            <div className="columna">
              <label className="etiqueta" htmlFor="name">Nombre:</label>
              <div className="contenedor-input">
                <input
                  className="campo-input"
                  type="text"
                  id="name"
                  name="name"
                  value={formData.name}
                  onChange={handleChange}
                />
              </div>
            </div>
            <div className="columna">
              <label className="etiqueta" htmlFor="email">Correo Electrónico:</label>
              <div className="contenedor-input">
                <input
                  className="campo-input"
                  type="email"
                  id="email"
                  name="email"
                  value={formData.email}
                  onChange={handleChange}
                />
              </div>
            </div>
          </div>
          <div className="columna-flexible">
            <label className="etiqueta" htmlFor="message">Mensaje:</label>
            <textarea
              className="campo-input"
              id="message"
              name="message"
              value={formData.message}
              onChange={handleChange}
            ></textarea>
          </div>
          <button className="boton-enviar" type="submit">Enviar Mensaje</button>
        </form>
      </div>

      <div className="contact-info">
        <h2>¡COMUNÍCATE CON NOSOTROS!</h2>
        <p>O aún mejor, ¡Ven a visitarnos!</p>
        <p>Para más información, envíanos un correo a:</p>
        <p><a href="mailto:cientifico.alajuela@mep.go.cr">cientifico.alajuela@mep.go.cr</a></p>

        <div className="contact-address">
          <h3>COLEGIO CIENTÍFICO DE ALAJUELA</h3>
          <p>Avenida Central, Calle 18-20, Frente a Plaza Ferias</p>
          <p>Alajuela, Costa Rica</p>
          <p>Tel. (506) 2430-9782  (506) 2431-4405</p>
        </div>

        <div className="google-map">
          {/* Tu iframe de Google Maps aquí */}
          <iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3929.0311589500457!2d-84.22496222592396!3d10.01428489009186!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8fa0f9ceabdb63f7%3A0x3c0ff8aeada9972b!2sColegio%20Cient%C3%ADfico%20de%20Costa%20Rica%2C%20sede%20de%20Alajuela%20(UNED)!5e0!3m2!1ses-419!2scr!4v1706162341399!5m2!1ses-419!2scr" width="600" height="450" style={{ border: 0 }} allowFullScreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>
        </div>
      </div>
    </div>
  );
}

export default Contact;
